账号密码 参考文档： https://www.jianshu.com/p/d21cdf929a2e https://docs.mongodb.com/v3.6/tutorial/enable-authentication/ # 1.创建管理员账号
use admin
db.createUser( { user: "root", pwd: "123456", roles: [ { role: "userAdminAnyDatabase", db: "admin" } ] }
) # 2.登录
db.auth('root','123456')
mongo -u root -p 123456 # 3.授权 db.grantRolesToUser( "root", [ { role: "root", db: "admin" }, ]
)
db.grantRolesToUser("root",[{role:"readWrite",db:"common"}]) # 4.读写权限账号
db.createUser( { user: "admin", pwd: "123456", roles: [ { role: "readWriteAnyDatabase", db: "admin" } ] }
)
db.auth('admin','123456') # 5.查看权限账号
db.createUser( { user: "read", pwd: "123456", roles: [ { role: "readAnyDatabase", db: "admin" } ] }
) # 6.数据库权限账号
db.createUser({user:"hall",pwd:"123456",roles:[{role:"readWrite",db:"game-hall"}]}) # 7.删除用户
db.dropUser("slots") 性能统计设置 参考文档： https://docs.mongodb.com/v3.6/tutorial/manage-the-database-profiler/#database-profiling-view-status db.setProfilingLevel(1)
# 最近10条慢操作
db.system.profile.find().limit(10).sort( { ts : -1 } ).pretty() 数据备份还原 参考文档： https://docs.mongodb.com/v3.6/tutorial/backup-and-restore-tools/ https://www.cnblogs.com/clsn/p/8244206.html # 1.备份
cd /data/mongo/backup
mkdir 2020****
cd 2020****
mongodump --username root --password 123456
#显示备份目录大小
du -h --max-depth=1 /data/mongo/backup/ # 2.数据还原
mongorestore --host mongodb1.example.net --port 3017 --username user --password 'pass' /opt/backup/mongodump-2013-10-24
mongorestore -h 172.31.49.33:27017 -uroot -p123456 --authenticationDatabase admin -d game-hall -c club /data/mongo/backup/now/2022_01_07/game-hall/club.bson 常用命令 # 1.查询 昵称包含指定字符串，显示指定字段
db.role.find({"nick":{$regex:"Helen"}},{nick:1,rid:1,gold:1})
db.player.find({"level":{"$gte":50}},{_id:1,nick:1,level:1}) # 2.查询所有注册人数
db.getCollection('role').find({"roleType":0}).count({}) # 3.查询平台充值总和
db.billing_order.aggregate([ { $match: { status: 200 } }, { $group: { _id: "$platform", total: { $sum: "$price" } } }
]) # 4.查询总注册人数
db.role.aggregate([ { $group: { _id: "$roleType", count: { $sum: 1 } } }
]) # 5.查询最近时间段登录人数
db.role.aggregate([ { $match: { lastLoginTime: {"$gt":ISODate("2021-01-01T00:00:01.303Z")} } }, { $group: { _id: "$roleType", count: { $sum: 1 } } }
])
db.role.aggregate([ { $match: { registerTime: {"$lt":ISODate("2021-01-08T00:00:01.303Z"),"$gt":ISODate("2021-01-07T00:00:01.303Z")} } }, { $group: { _id: "$roleType", count: { $sum: 1 } } }
]) # 6.查询人数大于10的公会
db.club.aggregate([ {$project:{memberCount:{$size:"$memberIds"}}}, {$match:{memberCount: {$gte:10}}} ]).itcount() # 7.模糊查询
{"nick":{$regex:/^.*emp.*$/i}} # 8.删除
db.config_board.deleteMany({"type":2}) # 9.数组大小查询
{"firstEnter":true,"refreshTime":{"$gt":1646024300450},"pushCoin.levelEntries":{"$exists":true},"$where": "this.pushCoin.levelEntries.length>1" } # 10.查看可用连接
db.serverStatus().connections # 11.查询性能分析
db.account.find({"rid":1000037}).explain("executionStats") # 12.创建索引
db.account.createIndex( { "accountName" : 1 } )
